import React, { useState } from "react";
// import axios from "axios";
// import { useNavigate } from "react-router-dom";
import { Typography, TextField, Button } from "@mui/material";

function Quiz() {
    const [question, setQuestion] = useState("Which house was Harry Potter almost sorted into")
    const [answer, setAnswer] = useState("Slytherin")
    const [userAnswer, setUserAnswer] = useState("")

    // const navigate = useNavigate()

    return (
        <div className="quiz">
            <form>
                <Typography variant="h5">Question 1</Typography>
                <br />
                <Typography variant="h4">{question}</Typography>
                <br />
                <br />
                <TextField
                    label="Answer"
                    variant="outlined"
                    value={userAnswer}
                    onChange={(input) => {
                        setUserAnswer(input.target.value)
                    }}
                />
                <br />
                <br />
                <Button variant="contained" color="primary">Send Answer</Button>
            </form>
        </div>
    )
}

export default Quiz
